import React from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

const Cost = (props) => {
  budget = this.props.budget;
  return (
    <div>
      <Container
        style={{
          alignitems: "center",
          textAlign: "left",
          fontWeight: "bold",
          color: "blue",
        }}
      >
        <Card>
          <Card.Body>
            {/* <h1>
              {/* {" "}
              name={props.children} budget={props.budget}{" "} */}
            {/* </h1> */} */}
            {props.budget.map((item) => (
              <h2>{item.budget}</h2>
            ))}
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};
// }

export default Cost;
